import React, { Component } from 'react';

import login from './screens/login'
import { BrowserRouter as Router, Route } from "react-router-dom";
import './App.css';


class App extends Component {
  render() {
    return (
      <Router>
      <div>
      <Route path="/Login" component={login} />
      </div>
      </Router>     

    );
  }
}

export default App;
